description:
Cần bán nhanh căn nhà C4 ngay mặt chợ thuộc Đặng Xá, Gia Lâm, Hà Nội:
- Dt 45m2, mt 4.5m;
- Có sẵn nhà C4 cho thuê có dòng tiền;
- Đường sau oto qua, đường trước mặt chính chợ - kinh doanh;
- Khu dân cư đông đúc;
- Di chuyển vào nội thành chỉ mất 15p chạy xe;
- Sổ đỏ đầy đủ sang tên;
- Giá chỉ 4.65 tỷ (có thương lượng)
LH em sdt/ZL để xem 24/7....

Cần bán gấp căn chung cư góc Đặng Xá, Gia Lâm:
- Dt 70m2, 2PN, 1WC
- Đồ đạc cơ bản đầy đủ;
- Ban công đông nam cực mát;
- Tầng cao đẹp;
- Sổ hồng đầy đủ sang tên;
- Giá chỉ 2.85 tỷ có thương lượng;
- lh EM QUA SDT/ZL để xem 24/7
